list_iris_files = []
for l in new_list_urls:
	if 'raster.tar.gz' in l:
	# name_dir = l[l.find('iris_l2'):l.find('_raster.tar')]
		name_dir = l.replace('_compressed', '')
		name_dir = name_dir[0:name_dir.find('iris_l2')]
		list_iris_files.append(find.find(name_dir, 'iris_l2*raster*t000_r00000*fits')[0])
to_test = []
for iris_file in list_iris_files:
	to_test.append(re.findall(r'l2_(\d*_\d*_\d*)', iris_file)[0])

data = []
method = "minimize"
for img in to_test:
	try:
		iris, aia = alignlib.load(img)
		print("image loaded")
		start = time.time()
		match method:
			case "minimize":
				a, i, b = 0.214907, 0.281563, 22.554918
				align = alignlib.super_align(aia, iris, a, i, b)
				res = align.nm_minimize()
			case "evolve":
				a, i, b = 0.213215, 0.285943, 23.958051
				align = alignlib.super_align(aia, iris, a, i, b)
				res = align.evolve()
			case "basin":
				a, i, b = 0.255986, 0.318812, 22.753841
				align = alignlib.super_align(aia, iris, a, i, b)
				res = align.basin_hop()

		end = time.time()
		data.append([img, a, i, b, res['x'][0], res['x'][1], res['x'][2], res['fun'], end - start])
		print("Confirmed")
	except:
		print("Error Happened")
		print("OBSID: ", img)
		data.append([img, None, None, None, None, None, None, None, None])

df = pd.DataFrame(data, columns=["OBSID", "AIA_N_GUESS", "IRIS_N_GUESS", "BLUR_GUESS", "OPTIMIZED_AIA",
                                 "OPTIMIZED_IRIS",
                                 "OPTIMIZED_BLUR", "RESULT", "RUNTIME"])
df.to_csv("mass_results_minimize.csv")


